INSERT INTO `ln_hall_works` VALUES ('301', '12', '野火', '/uploads/20201230/3d26007eab9ac671193d5c609b0ede01.png', '张占占', 'two', '1609220433', '1', '我所有的作品其实只有一个主题，那就是孤独。张占占，【原名张占龙】男。\r\n1982 年生于河北，现居北京\r\n2008 毕业于南京艺术学院美术学院雕塑系\r\n2010-今 居北京。展览 2005 江苏省新人新作油画展 江苏省美术馆 【南京】\r\n2006 新力量当代艺术展 南京市美术馆 【 南京】\r\n2007 金陵48景油画展 南京梅花山书画院 【南京】\r\n2008 \"半扇门\"五人油画沙龙展 南京梅花山书画院 【 南京】 全国优秀毕业生雕塑作品展 世纪华侨城 【 北京】', '710', '600', '', '', '/uploads/20210104/cad1054f3c16ff4e6d378b8dd696039c.png', '1609220433');
INSERT INTO `ln_hall_works` VALUES ('302', '12', '遇见你', '/uploads/20201230/3c445ac8580cd500ef38b74fe935c68e.png', '张占占', 'two', '1609220433', '2', '我所有的作品其实只有一个主题，那就是孤独。张占占，【原名张占龙】男。\r\n1982 年生于河北，现居北京\r\n2008 毕业于南京艺术学院美术学院雕塑系\r\n2010-今 居北京。展览 2005 江苏省新人新作油画展 江苏省美术馆 【南京】\r\n2006 新力量当代艺术展 南京市美术馆 【 南京】\r\n2007 金陵48景油画展 南京梅花山书画院 【南京】\r\n2008 \"半扇门\"五人油画沙龙展 南京梅花山书画院 【 南京】 全国优秀毕业生雕塑作品展 世纪华侨城 【 北京】', '750', '600', '', '', '/uploads/20210104/cad1054f3c16ff4e6d378b8dd696039c.png', null);
INSERT INTO `ln_hall_works` VALUES ('303', '12', '朋友们，飞翔吧！', '/uploads/20201230/9c9aa9556843e5245699b880f7f556c4.png', '刘海轮', 'two', '1609220433', '3', '生于1987年，当代青年艺术家，毕业于北华大学油画专业，现居济南。作品涉及油画、装置、水彩等。\r\n作品刊登/发表于《美术报》、《湖北卫视》《中国青年报》、《扬子晚报》、《江南时报》、《小米画报》、《ZAKER》、《大艺刊》、《水墨元素》等。\r\n2020年11月—2021年1月，“冬天来了，保持可爱”熊小木主题展（天津陆家嘴中心·陆+艺术中心和天津听湖美术馆）\r\n2018年10月，独角兽海滩艺博会，刘海轮独立个展（阿那亚黄金海岸）\r\n2018年7—9月，夜有微风——刘海轮水彩作品展', '750', '470', '', '', '/uploads/20210104/a496d4f7e9c76b23cea7e062c934ecf1.png', null);
INSERT INTO `ln_hall_works` VALUES ('304', '12', '跨越时空的凝视', '/uploads/20201230/4f93bb3f1f60739482a657a2dde32a23.png', '刘海轮', 'two', '1609220433', '4', '生于1987年，当代青年艺术家，毕业于北华大学油画专业，现居济南。作品涉及油画、装置、水彩等。\r\n作品刊登/发表于《美术报》、《湖北卫视》《中国青年报》、《扬子晚报》、《江南时报》、《小米画报》、《ZAKER》、《大艺刊》、《水墨元素》等。\r\n2020年11月—2021年1月，“冬天来了，保持可爱”熊小木主题展（天津陆家嘴中心·陆+艺术中心和天津听湖美术馆）\r\n2018年10月，独角兽海滩艺博会，刘海轮独立个展（阿那亚黄金海岸）\r\n2018年7—9月，夜有微风——刘海轮水彩作品展', '750', '540', '', '', '/uploads/20210104/a496d4f7e9c76b23cea7e062c934ecf1.png', null);
